pragma solidity > 0.8.0;

contract TestingContract {
  address[] contractAddresses;

  mapping(address => uint) getPrice;
  mapping(address => uint) getLimit;
  mapping(address => uint) getSpeed;
  mapping(address => uint) getLength;


  constructor(address[] memory _addresses) {
    contractAddresses = _addresses;
    for (uint _i = 0; _i < contractAddresses.length; _i++) {
      getPrice[contractAddresses[_i]] = (_i+1)*10;
      getLimit[contractAddresses[_i]] = (_i+1)*10;
      getSpeed[contractAddresses[_i]] = (_i+1)*10;
      getLength[contractAddresses[_i]] = (_i+1)*10;
    }
  }


  function getContractList() public view returns (address[] memory) {
    address[] memory _addresses = new address[](contractAddresses.length);
    for (uint _i = 0; _i < contractAddresses.length; _i++) {
      _addresses[_i] = contractAddresses[_i];
    }
    return _addresses;
  }


  function getAddressPrice(address _address) public view returns (uint) {
    return getPrice[_address];
  }

  function getAddressLimit(address _address) public view returns (uint) {
    return getLimit[_address];
  }

  function getAddressSpeed(address _address) public view returns (uint) {
    return getSpeed[_address];
  }

  function getAddressLength(address _address) public view returns (uint) {
    return getLength[_address];
  }

}
